INSERT INTO `products` (`id`, `name`, `image`, `price`, `description`, `category`, `created_at`) VALUES
(5, 'Essential SmartBright LED Downlight', , 20.00, 'Essential SmartBright G2 LED Downlight is an affordable product with high lighting power, good quality and reliability. Offers many configurations from 300lm to 2000lm output, to replace conventional down beam lights. Can be used for shopping malls, retail stores, residential areas and offices. This lamp is an ideal product to distribute on the market.', 'Indoor Luminer', '2024-12-22 21:00:16'),
(6, 'GreenSpace Accent Elbow GCGM', , 20.00, 'Brighten up your workspace or shop with Philips accent downlights, and add soft lighting that blends perfectly with the ceiling. Philips LED accent downlights offer cost efficiency without compromising on high-quality lighting standards.', 'Indoor Luminer', '2024-12-22 21:02:02'),
(7, 'GreenUp Grid', , 20.00, 'In the world of Retail & Hospitality, the availability of a variety of choices is an important element and is always sought after for this specific use. The GreenSpace Grid product range offers a complete range of options with the availability of comprehensive controls, optical solutions and powerful lumen output, as well as guaranteed reliability and product quality in a compact luminaire body.', 'Indoor Luminer', '2024-12-22 21:06:09'),
(8, 'GreenPerform Panel RC099V G3', , 20.00, 'The GreenPerform RC099V G3 panel is an affordable LED panel that delivers comfortable light with excellent uniformity. Offers 3 types, 600x600, 300x1200, and 600x1200 mm with max: 140 lm/w. The UGR19 brings more visual comfort to the office. Equipped with Dali, Interact and EcoSet, the RC099V G2 offers easy connection to control systems to deliver better energy savings.', 'Indoor Luminer', '2024-12-22 21:07:10'),
(9, 'GreenPerform Batten G3 BN398C', , 20.00, 'GreenPerform batten BN398C is a cost competitive linear solution with good performance and double lumen output for retail and industrial applications. This product offers both surface mounting and suspension mounting to suit a variety of mounting options. The multi-optical design also accommodates a wide range of applications.', 'Indoor Luminer', '2024-12-22 21:08:14');
INSERT INTO `products` (`id`, `name`, `image`, `price`, `description`, `category`, `created_at`) VALUES
(10, 'GreenVision Xceed Gen2', , 20.00, 'Sustainability, citizen well-being and connectivity are key players in the game of differentiation among cities around the world. And the way to achieve this goal is lighting. Illuminating streets and roads improves the comfort, security and overall safety of our rapidly growing urban environment. Our GreenVision Xceed Gen2 makes affordable LED street lighting solutions that ensure ample lighting on your roads & streets. Signify\'s GreenVision Xceed Gen2 family provides your city with a flexible lighting system that can be used anywhere in urban spaces, highways and rural areas – our luminaires provide optimal light for all application areas. And, GreenVision Xceed Gen2 is ready to connect and work with the smart city ecosystem. Our new GreenVision Xceed Gen2 range is enhanced to give city lighting departments greater control – to choose the right light', 'Outdoor Luminer', '2024-12-22 21:20:58'),
(11, 'SmartBright LED Floodlight', , 20.00, 'SmartBright LED Floodlight is a multi-purpose flashlight designed to provide significant energy savings, an ideal solution for a variety of flashlight applications. This product is also designed to meet appropriate safety and performance standards, giving you reliability and long-lasting performance.', 'Outdoor Luminer', '2024-12-22 21:22:08'),
(12, 'UniStrip G4', , 20.00, 'The UniStrip G4 is a surface-mounted exterior scalable LED luminaire designed for facade and outdoor architectural lighting applications. A range of products to suit all your needs, wall washing, grazing, and also linear lighting. Its robust mechanical design and unique optics make it ideal for lighting building facades, bridges, overpasses and all applications requiring a linear lighting solution. Available in white, monochromatic, RGB, RGBW and customizable white and DMX control options up to 8 pixels (8ID) to give architects and designers the freedom to explore various concepts and designs without limitations.', 'Outdoor Luminer', '2024-12-22 21:23:52'),
(13, 'Uni Posttop Classic', , 20.00, 'Inspired by the famous street lanterns of the 20th century, the classic Philips Uni Posttop combines conventional classics with modern Philips design, meeting multiple criteria in quality and safety while delivering exceptional lumen performance by street lighting standards. Classic housing creates a contemporary feel that fits not only traditional settings but also modern environments. In addition, to meet various needs in application scenarios, Philips Uni Posttop provides two optical options, namely symmetrical and asymmetrical. Additionally, the classic Philips Uni Posttop features a NEMA socket as an option, which makes the fixture ready for smart systems based on 1-10V or Dali 2.0 interfaces.', 'Outdoor Luminer', '2024-12-22 21:25:41');
INSERT INTO `products` (`id`, `name`, `image`, `price`, `description`, `category`, `created_at`) VALUES
(14, 'Essential SmartBright Solar Flood Light', , 20.00, 'Solar powered shooting light DIY kit with lithium ferro phosphate battery inside the light, including remote control and installation accessories. IP 65 ABS plastic construction for durability and long service life. Available in 600, 900, and 1500 Lumens', 'Outdoor Luminer', '2024-12-22 21:27:01'),
(15, 'MASTER LEDtube EM/Mains T8', , 20.00, 'The Philips MASTER LEDtube integrates a LED light source into a traditional fluorescent form factor. Its unique design creates a perfectly uniform visual appearance which cannot be distinguished from traditional fluorescent. This product is the ideal solution for up lamping in general lighting applications.', 'LED', '2024-12-23 18:19:42'),
(16, 'MASTER LEDspot LV AR111', , 19.99, 'Delivering a warm, halogen-like accent beam, MASTER LEDspot LV AR111 is an ideal retrofit solution for spot and general lighting applications in the hospitality and retail industry. It is particularly suitable for general lighting where the light is on all the time, such as creative accent lighting applications in shops, restaurants, hotels, and especially for galleries, exhibitions and museums. The robustly designed MASTER LEDspot LV AR111 offers various beam angles for a clearly defined beam spread. There is no UV or IR in the beam, making it suitable for illuminating heat-sensitive objects (food, organic materials, paintings, etc.). The patented intelligent driver enables broad compatibility with existing electromagnetic and electronic halogen transformers. MASTER LEDspot LV AR111 delivers huge energy savings and minimises maintenance cost without any reduction in brightness.', 'LED', '2024-12-23 18:20:44');
INSERT INTO `products` (`id`, `name`, `image`, `price`, `description`, `category`, `created_at`) VALUES
(17, 'MASTER - LED HID SON-T', , 20.00, 'Philips MASTER - LED HID SON-T lamps are an easy LED solution with a short payback period to replace High-Intensity Discharge (HID) and High-Pressure Sodium (SON) lamps. MASTER – LED HID SON-T solutions bring the energy efficiency and long lifetime benefits of LED to HID replacement, providing instant savings for a low initial investment. With the right lamp size and light distribution, you can easily retrofit MASTER – LED HID SON-T lamps into existing SON and SON-T systems, enhancing the lighting quality with LED without changing the luminaire’s ballast (for IF replacements) or reflector.', 'LED', '2024-12-23 18:21:44'),
(18, 'MASTER Plastic LEDbulbs', , 20.00, 'MASTER LEDbulb range delivers a dimmable glow effect for a welcoming, warm atmosphere, making it ideal for general lighting applications in the hospitality industry. Its unique design radiates warm light in all directions, making it a true alternative to the incandescent lamp. It is particularly suitable for public areas such as lobbies, corridors, stairwells, where the light is always on. Compatible with existing fixtures with an E27 or a B22 holder and designed for retrofit replacement of incandescent bulbs, MASTER LEDbulb delivers huge energy savings and minimises maintenance cost without any compromise on light quality.', 'LED', '2024-12-23 18:24:21'),
(19, 'CorePro LED PLC 2P', , 20.00, 'CorePro LED PLC 2P integrates a LED light source into a traditional fluorescent form factor. This product is the ideal solution for uplamping in general lighting applications: it meets basic lighting requirements, offers significant energy savings, and is environmentally friendly.', 'LED', '2024-12-23 18:25:29');

